INSERT INTO `movie_info` VALUES ('102 Not Out','http://developer.tmsimg.com/assets/p15347842_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-05-04','PG','01H','42M','Dattatraya Vakharia is a 102-year-old man who wants to break the record of oldest living male. There\'s just one problem -- he must find a way to change the sad and grumpy demeanor of his 75-year-old son.'),('A Bag of Marbles','http://developer.tmsimg.com/assets/p14247664_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-01-15',NULL,'01H','50M','A Jewish kid and his brother escape from the Nazis in occupied France.'),('A Fantastic Woman','http://developer.tmsimg.com/assets/p14534644_v_v5_ae.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-02-11','R','01H','43M','From the producers of Jackie, Spotlight and Toni Erdmann.'),('A Night of Comedy Shorts','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('A Quiet Place','http://developer.tmsimg.com/assets/p14660087_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-09','PG-13','01H','35M','In upstate New York, a couple and their two children must remain silent in their isolated farmhouse to avoid mysterious creatures that use sound to hunt their prey. Using sign language and eye contact to communicate, the family members must rely on one another -- and their wits -- to live to see the next day.'),('A Summer Place','http://developer.tmsimg.com/assets/p2111_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1959-10-22',NULL,'02H','10M','The big-screen adaptation of Sloan Wilson\'s popular novel follows wealthy Ken Jorgenson (Richard Egan) as he brings his wife (Constance Ford) and teenage daughter, Molly (Sandra Dee), to the Maine vacation spot where he worked as a middle-class youth. When Ken reunites with his former flame, the now-married Sylvia (Dorothy McGuire), it sparks a passionate tryst. Meanwhile, Sylvia\'s son, Johnny (Troy Donahue), and Molly begin a romance of their own, unaware of their parents\' affair.'),('A Wrinkle in Time','http://developer.tmsimg.com/assets/p14085794_v_v5_af.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-09','PG','01H','49M','Meg Murry and her little brother, Charles Wallace, have been without their scientist father, Mr. Murry, for five years, ever since he discovered a new planet and used the concept known as a tesseract to travel there. Joined by Meg\'s classmate Calvin O\'Keefe and guided by the three mysterious astral travelers known as Mrs. Whatsit, Mrs. Who and Mrs. Which, the children brave a dangerous journey to a planet that possesses all of the evil in the universe.'),('Achari America Yathra','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'','',''),('Acrimony','http://developer.tmsimg.com/assets/p14289024_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-30','R','02H','00M','When Melinda met Robert, she was skeptical of his charming nature but couldn\'t deny how attracted she was to him. Once they fell in love, Melinda molded herself into everything he wanted her to be. She sacrificed for him, worked to support his grandiose dreams, and put up with him for better or for worse. Then, one day she realized that after all she had done, another woman was reaping the lavish rewards. That\'s when Melinda lost it, and now she cannot let it go.'),('After Auschwitz','http://developer.tmsimg.com/assets/p14076494_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','23M','Hoping to find a sense of normalcy, six female Holocaust survivors immigrate to America, get married and raise children.'),('Afterglow','http://developer.tmsimg.com/assets/p19424_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1997-12-26','R','01H','53M','The appropriately named Lucky Mann (Nick Nolte) is a contractor equally handy at repairs and seduction. The latest lonely housewife to succumb to his charms is Marianne (Lara Flynn Boyle), childless and unhappy with her marriage to business-obsessed Jeffrey (Jonny Lee Miller). When Jeffrey coincidentally becomes enraptured by Lucky\'s wife, the fading former starlet Phyllis (Julie Christie), the four get caught in a tangled-up love quadrangle that reignites their tired marriages.'),('Alex & the List','http://developer.tmsimg.com/assets/p15369560_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-05-04',NULL,'01H','53M','Alex\'s beautiful girlfriend gives him a list of changes to make before he can win her hand in marriage. He must now figure out how to complete the list, fend off a suave competitor and secure her love.'),('Altered Perception','http://developer.tmsimg.com/assets/p15305270_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','19M','Four couples agree to participate in an experiment designed to treat psychological problems. At first, the treatment results are promising as their perception becomes clearer, but the couples start to perceive too much, and things turn deadly.'),('Amazon Adventure','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-04-18',NULL,'00H','45M','A true story of scientific discovery.'),('Amazon Adventure 3D','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-04-18',NULL,'00H','45M','A true story of scientific discovery.'),('American Socialist: The Life and Times of Eugene Victor Debs','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','37M','Eugene V. Debs was a founding member of the Socialist Party of America.'),('An Evening With Brent Green','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Andover','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018-05-04',NULL,'01H','35M','A desperate genetics professor clones his dead wife over and over again until she\'s the perfect re-creation of the woman that he loved.'),('Annie Hall','http://developer.tmsimg.com/assets/p7349_v_v5_ae.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1977-01-01','PG','01H','33M','Comedian Alvy Singer (Woody Allen) examines the rise and fall of his relationship with struggling nightclub singer Annie Hall (Diane Keaton). Speaking directly to the audience in front of a bare background, Singer reflects briefly on his childhood and his early adult years before settling in to tell the story of how he and Annie met, fell in love, and struggled with the obstacles of modern romance, mixing surreal fantasy sequences with small moments of emotional drama.'),('Annihilation','http://developer.tmsimg.com/assets/p14433008_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-23','R','01H','55M','Lena, a biologist and former soldier, joins a mission to uncover what happened to her husband inside Area X -- a sinister and mysterious phenomenon that is expanding across the American coastline. Once inside, the expedition discovers a world of mutated landscapes and creatures, as dangerous as it is beautiful, that threatens both their lives and their sanity.'),('Au Hasard Balthazar','http://developer.tmsimg.com/assets/p22838_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1966-10-01',NULL,'01H','30M','Un Ã¢ne est entourÃ© d\'amour et de misÃ¨re.'),('Ava','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','42M','A high school girl\'s life in Iran becomes more complicated when her mother catches her in an act of rebellion.'),('Avengers: Infinity War','http://developer.tmsimg.com/assets/p12863030_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Avengers: Infinity War -- An IMAX 3D Experience','http://developer.tmsimg.com/assets/p12863030_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Avengers: Infinity War -- The IMAX 2D Experience','http://developer.tmsimg.com/assets/p12863030_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Avengers: Infinity War 3D','http://developer.tmsimg.com/assets/p12863030_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','02H','29M','Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.'),('Baaghi 2','http://developer.tmsimg.com/assets/p15215156_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018