e-fighting days may be numbered.'),('Becoming Who I Was','http://developer.tmsimg.com/assets/p14619588_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','35M','After being identified as the reincarnation of a venerated Buddhist master, young Padma Angdu makes an arduous journey with his aging guardian from Northern India to Tibet to find his rightful place in the world.'),('Beirut','http://developer.tmsimg.com/assets/p14757770_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-01-22','R','01H','49M','In 1980s Beirut, Mason Skiles is a former U.S. diplomat who is called back into service to save a colleague from the group that is possibly responsible for his own family\'s death. Meanwhile, a CIA field agent who is working under cover at the American embassy is tasked with keeping Mason alive and ensuring that the mission is a success.'),('Beyond the Clouds','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-10-13',NULL,'02H','00M','After a hedonistic teenager in Mumbai gets busted for dealing drugs, he moves in with his estranged sister.'),('Bhai Taru Singh','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'','',''),('Bharat Ane Nenu','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-19',NULL,'02H','53M',''),('Bhaskar Oru Rascal','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','32M',''),('Black Panther','http://developer.tmsimg.com/assets/p12878741_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-16','PG-13','02H','14M','After the death of his father, T\'Challa returns home to the African nation of Wakanda to take his rightful place as king. When a powerful enemy suddenly reappears, T\'Challa\'s mettle as king -- and as Black Panther -- gets tested when he\'s drawn into a conflict