hing evil -- a demon which forces the friends to share dark secrets and confront their deepest fears. The rules are simple but wicked -- tell the truth or die, do the dare or die, and if you stop playing, you die.'),('Borg vs. McEnroe','http://developer.tmsimg.com/assets/p13776100_v_v5_ay.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-07','R','01H','48M','The story of the rivalry between two 1980s tennis stars, the placid BjÃ¶rn Borg and the volatile John McEnroe.'),('Braguino','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'00H','49M','A feud develops between two families in the Siberian forest.'),('Breaking In','http://developer.tmsimg.com/assets/p15051839_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-05-11','PG-13','01H','28M','Shaun Russell takes her son and daughter on a weekend getaway to her late father\'s secluded, high-tech vacation home in the countryside. The family soon gets an unwelcome surprise when four men break into the house to find hidden money. After managing to escape, Shaun must now figure out a way to turn the tables on the desperate thieves and save her captive children.'),('Bye Bye Germany','http://developer.tmsimg.com/assets/p14000734_st_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','42M','A Holocaust survivor who is trying make it to America is deprived of his savings and overtaken by his shady past.'),('Cake','http://developer.tmsimg.com/assets/p15219338_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','05M',''),('Call Me by Your Name','http://developer.tmsimg.com/assets/p14169043_v_v5_ao.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-01-22','R','02H','12M','It\'s the summer of 1983, and precocious 17-year-old Elio Perlman is spending the days with his family at their 17th-century villa in Lombardy, Italy. He soon meets Oliver, a handsome doctoral student who\'s working as an intern for Elio\'s father. Amid the sun-drenched splendor of