5_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-10-05',NULL,'01H','37M','Professor Phillip Goodman devotes his life to exposing phony psychics and fraudulent supernatural shenanigans. His skepticism soon gets put to the test when he receives news of three chilling and inexplicable cases -- disturbing visions in an abandoned asylum, a car accident deep in the woods and the spirit of an unborn child. Even scarier -- each of the macabre stories seems to have a sinister connection to the professor\'s own life.'),('Godard Mon Amour','http://developer.tmsimg.com/assets/p14840253_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-21','R','01H','47M','During the making of one of his films, French film director Jean-Luc Godard falls in love with 17-year-old actress Anne Wiazemsky and later marries her.'),('Godard, mon amour','http://developer.tmsimg.com/assets/p14840253_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-21','R','01H','47M',''),('Gonjiam: Haunted Asylum','http://developer.tmsimg.com/assets/p15288125_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13',NULL,'01H','33M','The crew of a horror web series travels to an abandoned asylum for a live broadcast. It soon encounters much more than expected as it moves deeper inside the nightmarish old building.'),('Grace Jones: Bloodlight and Bami','http://developer.tmsimg.com/assets/p15047130_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-07',NULL,'01H','56M','Electrifying concert performances and intimate, personal footage showcase the life and talent of singer and actress Grace Jones.'),('Halloween 4','http://developer.tmsimg.com/assets/p11211_p_v5_ad.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1988-10-21','R','01H','28M','The apparently comatose Michael Myers (George P. Wilbur) is being transferred from one hospital to another, but he wakes up when the ambulance crew talk about his surviving niece, Jamie (Danielle Harris). After slaughtering his attendants, Myers sets out to find his one living