grel friends, he begins an epic journey that will decide the fate and future of the entire Prefecture.'),('Ismael\'s Ghosts','http://developer.tmsimg.com/assets/p14760102_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017','R','01H','54M','Twenty-one years ago, she ran away -- and 21 years later, Carlotta is back from the void. But Ismael has been busy rebuilding a life for himself with Sylvia and working on his next movie. As Ismael\'s trials and tribulations unfurl, so too do those of his film\'s protagonist -- the idle, funny and reckless diplomat Ivan DÃ©dalus.'),('Itzhak','http://developer.tmsimg.com/assets/p14995769_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-10-05',NULL,'01H','23M','The life and music of Israeli conductor and musician Itzhak Perlman.'),('Jeannette: The Childhood of Joan of Arc','http://developer.tmsimg.com/assets/p14447360_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-21',NULL,'01H','45M','Young shepherdess Jeannette, the future Joan of Arc, already carries the weight of the the French nation on her shoulders as she grapples with matters of the soul.'),('John McEnroe: In the Realm of Perfection','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'','','John McEnroe faces Ivan Lendl in the final of the 1984 French Open.'),('Kanam','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','20M',''),('Karu','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-26',NULL,'02H','20M',''),('Kings','http://developer.tmsimg.com/assets/p15132644_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-13','R','01H','27M','Millie is a hardworking, tough and protective Los Angeles single mother with an affection for homeless children. Her neighbor Obie is the local loose cannon -- and the only white man -- in an area largely inhabited by African-Americans, Latinos and Koreans. With racial tensions running high, Millie and Obie appear to be unlikely allies. But following the acquittal of four of the officers accused of beating Rodney King, the two of them must navigate the gathering chaos in the city.'),('Kodachrome','http://developer.tmsimg.com/assets/p15198321_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-08',NULL,'01H','40M','Matt, a struggling executive, finds his world turned upside down when his estranged father\'s nurse shows up unexpectedly in his office. Matt\'s father, a famed bad-boy photojournalist, is facing terminal cancer and his dying wish is for Matt to join him on a road trip from New York to Kansas to process his last rolls of Kodachrome film before the sole remaining lab closes and those captured moments are gone forever.'),('L\'enfant secret','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','1979',NULL,'01H','32M','Four stories from the birth of a secret child.'),('Labyrinth','http://developer.tmsimg.com/assets/p9355_v_v5_ae.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1986-06-27','PG','01H','41M','Teenage Sarah (Jennifer Connelly) journeys through a maze to recover her baby brother (Toby Froud) from a goblin king (David Bowie).'),('Le Corbeau','http://developer.tmsimg.com/assets/p5616_b_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1943-09-28',NULL,'01H','32M','Le docteur RÃ©my Germain travaille dans une petite ville de province paisible, tellement paisible qu\'on a l\'impression parfois d\'y Ã©touffÃ©. Et soudain le scandale arrive : plusieurs habitants reÃ§oivent des lettres anonymes. Cruelles, mensongÃ¨res, grossiÃ¨res : ces missives touchent un peu tout le monde. Seul point commun, une signature : `Le Corbeau\'.'),('Lean on Pete','http://developer.tmsimg.com/assets/p14841156_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-01','R','02H','02M','Charley, a teenager living with his single father, cares for an ageing racehorse named Lean On Pete. When he learns Pete is bound for slaughter, the two embark on an odyssey across the new American frontier in search of a place to call home.'),('Let the Sunshine In','http://developer.tmsimg.com/assets/p14840724_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-06-23',NULL,'01H','35M','A film by Claire Denis, director of Beau travail and White Material.'),('Life of the Party','http://developer.tmsimg.com/assets/p14427239_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-05-11','PG-13','01H','45M','When her husband suddenly dumps her, longtime and dedicated housewife Deanna turns regret into reset by going back to college. Unfortunately, Deanna winds up at the same school as her less-than-thrilled daughter. Plunging headlong into the campus experience, the outspoken new student soon finds her true self while fully embracing all the fun, freedom and frat boys that she can handle.'),('Like Arrows','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'02H','00M','In the movie \"Like Arrows,\" a couple search for answers when they realize that their approach to raising children isn\'t working; includes an exclusive panel discussion with filmmakers Alex Kendrick, Stephen Kendrick, Dennis Rainey and Bob Lepine.'),('Liquid Sky','http://developer.tmsimg.com/assets/p49734_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1982','R','01H','52M','An alien creature invades New York\'s punk subculture in its search for an opiate released by the brain during orgasm.'),('Little Pink House','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-02-03',NULL,'01H','39M','A Connecticut nurse finds herself at the center of a political firestorm and a Supreme Court case centering on eminent domain.'),('Lobby & Handprints Tour','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',