romises his immense fortune to the first person to discover a digital Easter egg that\'s hidden somewhere in the OASIS. When young Wade Watts joins the contest, he finds himself becoming an unlikely hero in a reality-bending treasure hunt through a fantastical world of mystery, discovery and danger.'),('Ready Player One 3D','http://developer.tmsimg.com/assets/p12806300_p_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-29','PG-13','02H','20M','In 2045, the planet is on the brink of chaos and collapse, but people find salvation in the OASIS, an expansive virtual reality universe created by James Halliday. When Halliday dies, he promises his immense fortune to the first person to discover a digital Easter egg that\'s hidden somewhere in the OASIS. When young Wade Watts joins the contest, he finds himself becoming an unlikely hero in a reality-bending treasure hunt through a fantastical world of mystery, discovery and danger.'),('Ready Player One: An IMAX 3D Experience','http://developer.tmsimg.com/assets/p12806300_p_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-29','PG-13','02H','20M','In 2045, the planet is on the brink of chaos and collapse, but people find salvation in the OASIS, an expansive virtual reality universe created by James Halliday. When Halliday dies, he promises his immense fortune to the first person to discover a digital Easter egg that\'s hidden somewhere in the OASIS. When young Wade Watts joins the contest, he finds himself becoming an unlikely hero in a reality-bending treasure hunt through a fantastical world of mystery, discovery and danger.'),('Rogers Park','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','27M','Two Chicago couples struggle to keep their love alive.'),('Royal Opera House: Carmen','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Saboteur','http://developer.tmsimg.com/assets/p2632_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1942-04-22','PG','01H','48M','Factory worker Barry Kane (Robert Cummings) is wrongfully accused of setting a deadly fire at an airplane plant in an apparent act of sabotage. Kane believes that the fire was set by another worker (Norman Lloyd), and he travels across the country to find the mysterious saboteur. Along the way he is forced to take Patricia Martin (Priscilla Lane) hostage, but as he begins to earn her trust, she turns from an unwilling captive to a willing accomplice in his quest to help clear his name.'),('Scene of the Crime','http://developer.tmsimg.com/assets/p12373_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1986',NULL,'01H','30M','While wandering through a cemetery, Thomas comes upon Martin -- an escaped convict who commands the teenage boy to bring him money for the train. Thomas, who has few friends and a troubled relationship with his mother, Lili, dutifully returns that night with the cash. But Thomas\' relationship with the fugitive is far from over, especially when Martin runs into the boy\'s mother at the bar where she works.'),('Sgt. Stubby: An American Hero','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-13','PG','01H','25M','With World War I looming, Robert Conroy, a young Army private, adopts a stray, stump-tailed terrier. Conroy names his new friend Stubby and gives him a home, a family, and a chance to embark on the adventure that would define a century. The two quickly find themselves in the trenches of France and on the path to history. French soldier Gaston Baptiste befriends the man and dog and accompanies them along their epic journey through harsh conditions and incredible acts of courage.'),('Sherlock Gnomes','http://developer.tmsimg.com/assets/p13794695_p_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-23','PG','01H','26M','When Gnomeo and Juliet first arrive in London with their friends and family, their biggest concern is getting a new garden ready for spring. When everyone in the garden suddenly goes missing -- there\'s only one gnome to call -- Sherlock Gnomes. The famous detective and sworn protector of the city shows up with his sidekick Watson to investigate the case. The mystery soon leads the gnomes on a rollicking adventure as they meet all-new ornaments and explore an undiscovered side of London.'),('Silence','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','1971',NULL,'02H','09M','Two Portuguese priests go to Japan to help Christian sects, driven underground by a ruthless magistracy, to regain a foothold. Quickly drawn into a mire of persecution, the missionaries soon learn the fate of a mission decades earlier.'),('Songwriter','http://developer.tmsimg.com/assets/p8545_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1984','R','01H','34M','Doc Jenkins (Willie Nelson) is a country music star who\'s become fed up with the industry. With some help from Blackie Buck (Kris Kristofferson), his old partner, and Gilda (Lesley Ann Warren), a rising star he\'s been mentoring, he tries to get back at Rodeo Rocky (Richard Sarafian), a ruthless promoter who\'s swindled him out of the publishing rights to his songs. Doc also sets out to get back together with his kindly ex-wife, Honey (Melinda Dillon).'),('Super Troopers 2','http://developer.tmsimg.com/assets/p14477928_p_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-20','R','01H','43M','Fired for their previous shenanigans, former Vermont Highway Patrol officers Thorny, Farva, Rabbit, Foster and Mac get a shot at redemption from Capt. O\'Hagan and Gov. Jessan. The wacky quintet must provide law enforcement for a French Canadian town that\'s transitioning to U.S. sovereignty. Their unconventional methods soon get put to the test when they encounter a smarmy mayor, mischievous Mounties, a smuggling ring and a 1,300-pound bear.'),('Supercon','http://developer.tmsimg.com/assets/p15314648_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','R','01H','40M','They have been cosplayed for the last time.'),('Swathanthryam Ardharathriyil','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'02H','18M','A manager at a big financial firm is sent to jail after he tries to help the woman he loves escape a criminal charge. The only way he can make it is to find a way to break out of prison.'),('Sympathy for the Devil','http://developer.tmsimg.com/assets/p5976_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1968',NULL,'01H','39M','Scenes from the Rolling Stones\' recording studio sessions are interspersed with footage of the Vietnam War.'),('The 12th Man','http://developer.tmsimg.com/assets/p15377655_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'02H','11M','A member of the Norwegian resistance attempts to reach Sweden before the Gestapo can apprehend him.'),('The Boarder','http://developer.tmsimg.com/assets/p10484736_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2012-07-25',NULL,'01H','35M','A couple (Leslie Stevens, Carlton Wilborn) adopt a homeless, 11-year-old boy (Andy Scott Harris) who has a knack for causing trouble.'),('The Boxcar Children -- Surprise Island','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'01H','40M','Martin Sheen, J.K. Simmons, Griffin Gluck, Joey King and Dane DeHaan star in the animated film \"The Boxcar Children: Surprise Island,\" based on the children\'s book by Gertrude Chandler Warner; includes a special introduction and a short program.'),('The Cat Returns -- Studio Ghibli Fest 2018','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','','','01H','25M','A dapper feline takes a lucky schoolgirl on a magical adventure in the anime film \"The Cat Returns\"; dubbed in English on April 22 and April 25, and subtitled on April 23.'),('The Death of Stalin','http://developer.tmsimg.com/assets/p14589654_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-09-08','R','01H','47M','When tyrannical dictator Joseph Stalin dies in 1953, his parasitic cronies square off in a frantic power struggle to become the next Soviet leader. Among the contenders are the dweebish Georgy Malenkov, the wily Nikita Khrushchev and Lavrenti Beria -- the sadistic secret police chief. As they bumble, brawl and back-stab their way to the top, the question remains -- just who is running the government?'),('The Devil and Father Amorth','http://developer.tmsimg.com/assets/p15076386_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-08-31',NULL,'01H','08M','Filmmaker William Friedkin follows the Rev. Gabriele Amorth as he performs an exorcism on a woman in Italy.'),('The Escape of Prisoner 614','http://developer.tmsimg.com/assets/p15245324_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27','PG-13','01H','30M','After two deputy sheriffs lose their jobs because of poor arrest records, they pursue an escaped convict to try and win back their badges. Nabbing the convict won\'t be half as dangerous as facing the ruthless sheriff who is tracking their every move.'),('The Exorcist','http://developer.tmsimg.com/assets/p6107_v_v5_ay.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1973-12-26','R','02H','02M','One of the most profitable horror movies ever made, this tale of an exorcism is based loosely on actual events. When young Regan (Linda Blair) starts acting odd -- levitating, speaking in tongues -- her worried mother (Ellen Burstyn) seeks medical help, only to hit a dead end. A local priest (Jason Miller), however, thinks the girl may be seized by the devil. The priest makes a request to perform an exorcism, and the church sends in an expert (Max von Sydow) to help with the difficult job.'),('The Fisher King','http://developer.tmsimg.com/assets/p13435_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1991-09-20','R','02H','12M','After shock jock Jack Lucas (Jeff Bridges) inadvertently provokes a caller into murdering a group of innocent people in a Manhattan bar, he grows depressed and turns to booze. As he\'s about to hit rock bottom, Lucas meets a homeless man named Parry (Robin Williams), whose wife was killed by the caller Lucas pushed to the brink. Mentally scarred by his loss, Parry spends his days searching for the Holy Grail. Lucas, feeling culpable for the poor man\'s plight, pledges to help him in his quest.'),('The Great Silence','http://developer.tmsimg.com/assets/p89877_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1968',NULL,'01H','45M','On an unforgiving, snow-swept frontier, a group of bloodthirsty bounty hunters, led by the vicious Loco, preys on a band of persecuted outlaws who have taken to the hills. As the price on each head is collected one-by-one, only a mute gunslinger named Silence stands between the innocent refugees and the greed and corruption that the bounty hunters represent. But in this harsh, brutal world, the lines between right and wrong aren\'t always clear and good doesn\'t always triumph.'),('The House of Tomorrow','http://developer.tmsimg.com/assets/p14824782_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-04-08',NULL,'01H','25M','A sheltered, socially-awkward teen becomes friends with a green-haired heart transplant patient who introduces him to punk rock.'),('The IMAX VR: Justice League VR: Cyborg Flash, Wonder Woman','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('The Intruder','http://developer.tmsimg.com/assets/p7473_b_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1962-05-14','PG-13','01H','24M','A charismatic stranger (William Shatner) stirs up racist sentiments in a small town to prevent school integration from happening there.'),('The Killers','http://developer.tmsimg.com/assets/p4181_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1946-08-28',NULL,'01H','45M','Two hit men walk into a diner asking for a man called \"the Swede\" (Burt Lancaster). When the killers find the Swede, he\'s expecting them and doesn\'t put up a fight. Since the Swede had a life insurance policy, an investigator (Edmond O\'Brien), on a hunch, decides to look into the murder. As the Swede\'s past is laid bare, it comes to light that he was in love with a beautiful woman (Ava Gardner) who may have lured him into pulling off a bank robbery overseen by another man (Albert Dekker).'),('The Metropolitan Opera: Cendrillon Encore','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'03H','15M','Bertrand de Billy conducts mezzo-soprano Joyce DiDonato, mezzo-soprano Alice Coote, soprano Kathleen Kim and mezzo-soprano Stephanie Blythe in an encore performance of Massenet\'s \"Cendrillon.\"'),('The Miracle Season','http://developer.tmsimg.com/assets/p14953815_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-06','PG','01H','39M','Based on the inspiring true story of the West High School girl\'s volleyball team. After the tragic loss of star player Caroline \"Line\" Found in an accident, the remaining team players must band together under the guidance of their tough-love coach, Kathy Bresnahan, in hopes of winning the state championship.'),('The Moderns','http://developer.tmsimg.com/assets/p10724_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1988-05-27','R','02H','06M','In the Roaring Twenties, aspiring painter Nick Hart (Keith Carradine), a U.S. expat who has decamped to Paris, tries to scrape together a living. He has a talent for reproductions but his own work is not selling well, so he takes a job forging famous paintings for rich art patron Nathalie de Ville (Geraldine Chaplin). However, things get awkward when Hart\'s ex-wife, Rachel (Linda Fiorentino), shows up with her new husband, Bertram Stone (John Lone), who attempts to buy the counterfeits.'),('The Pit and the Pendulum','http://developer.tmsimg.com/assets/p1757_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1961',NULL,'01H','20M','Elizabeth Barnard Medina (Barbara Steele) has died in the prime of life, and her brother, Francis (John Kerr), wants to know why. Elizabeth\'s husband, Nicholas (Vincent Price), and her doctor offer differing explanations, but when Francis learns that Nicholas\' mother may have been buried alive, he begins to wonder if his sister met the same fate. And when he comes to believe that Elizabeth\'s spirit wanders about Nicholas\' castle, Francis investigates -- and is stunned by what he finds.'),('The Rachel Divide','http://developer.tmsimg.com/assets/p15262005_b_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27',NULL,'01H','30M','Rachel Dolezal, the former leader of the NAACP\'s Spokane branch, becomes a national news story when she is exposed for faking her black ancestry.'),('The Rider','http://developer.tmsimg.com/assets/p14671211_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-20','R','01H','44M','After a riding accident leaves him unable to compete on the rodeo circuit, a young cowboy searches for a new purpose.'),('The Seventh Seal','http://developer.tmsimg.com/assets/p31330_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','1956-10-13',NULL,'01H','36M','When disillusioned Swedish knight Antonius Block (Max von Sydow) returns home from the Crusades to find his country in the grips of the Black Death, he challenges Death (Bengt Ekerot) to a chess match for his life. Tormented by the belief that God does not exist, Block sets off on a journey, meeting up with traveling players Jof (Nils Poppe) and his wife, Mia (Bibi Andersson), and becoming determined to evade Death long enough to commit one redemptive act while he still lives.'),('The Shape of Water','http://developer.tmsimg.com/assets/p14064584_v_v5_ad.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-08-31','R','02H','03M','Elisa is a mute, isolated woman who works as a cleaning lady in a hidden, high-security government laboratory in 1962 Baltimore. Her life changes forever when she discovers the lab\'s classified secret -- a mysterious, scaled creature from South America that lives in a water tank. As Elisa develops a unique bond with her new friend, she soon learns that its fate and very survival lies in the hands of a hostile government agent and a marine biologist.'),('The Test and the Art of Thinking','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-27',NULL,'01H','25M','The history and evolution of the SAT/ACT as a major player on the pathway to higher education in America.'),('This Is Our Land','http://developer.tmsimg.com/assets/p14297094_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','57M','A nurse gets involved in a far right political party.'),('Traffik','http://developer.tmsimg.com/assets/p14514003_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-04-20','R','01H','36M','Brea and John embark on a romantic weekend getaway to an isolated estate in the mountains. They are pleasantly surprised when two of their friends, Darren and Malia, also show up unexpectedly. Their plans for fun soon give way to terror when members of a violent biker gang invade the peaceful countryside. Banded together, they now find themselves in a fight for their lives as their assailants will stop at nothing to protect their secrets from the outside world.'),('Truth Be Told','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Tully','http://developer.tmsimg.com/assets/p14123058_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-01-23','R','01H','34M','Marlo is a New York suburbanite who\'s about to give birth to her third child. Her husband Ron is loving and works hard, but remains clueless about the demands that motherhood puts on his wife. When the baby is born, Marlo\'s wealthy brother hires a nighttime nanny named Tully to help his sister handle the workload. Hesitant at first, Marlo soon learns to appreciate all that Tully does -- forming a special bond with her new, lifesaving friend.'),('Tyler Perry\'s Acrimony','http://developer.tmsimg.com/assets/p14289024_i_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-03-30','R','02H','00M','When Melinda met Robert, she was skeptical of his charming nature but couldn\'t deny how attracted she was to him. Once they fell in love, Melinda molded herself into everything he wanted her to be. She sacrificed for him, worked to support his grandiose dreams, and put up with him for better or for worse. Then, one day she realized that after all she had done, another woman was reaping the lavish rewards. That\'s when Melinda lost it, and now she cannot let it go.'),('Unsane','http://developer.tmsimg.com/assets/p14830399_p_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2018-02-20','R','01H','38M','Sawyer Valentini relocates from Boston to Pennsylvania to escape from the man who\'s been stalking her for the last two years. While consulting with a therapist, Valentini unwittingly signs in for a voluntary 24-hour commitment to the Highland Creek Behavioral Center. Her stay at the facility soon gets extended when doctors and nurses begin to question her sanity. Sawyer now believes that one of the staffers is her stalker -- and she\'ll do whatever it takes to stay alive and fight her way out.'),('Veneno','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2018',NULL,'01H','36M','Jack Veneno becomes the most famous Dominican wrestler of all time and faces his archrival, Relampago Hernandez.'),('VIP TCL Chinese Theatre Tour','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('VR: Eagle Flight','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('VR: Raw Data V1.1','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq',NULL,NULL,'','',''),('Wanderland','http://developer.tmsimg.com/assets/p15373362_v_v5_ab.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017',NULL,'01H','29M','Seeking an escape from his isolated life in New York, Alex accepts a mysterious invitation to house-sit a picturesque cottage on Long Island.'),('Where Is Kyra?','http://developer.tmsimg.com/tvbanners/generic/generic_tvbanners_v5.png?api_key=54jmnjmpmgek7ydjy7984zxq','2017-01-23',NULL,'01H','38M','A fragile woman is already stressed from a fast-paced world when her mother dies and she must find a means for survival while hiding her struggles from her new boyfriend.'),('You Were Never Really Here','http://developer.tmsimg.com/assets/p14834818_v_v5_ac.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-05-27','R','01H','30M','When a teenage girl goes missing, a jaded, brutal enforcer attempts a rescue mission. He uncovers corruption and abuse of power along his way.'),('Zama','http://developer.tmsimg.com/assets/p14591881_v_v5_aa.jpg?api_key=54jmnjmpmgek7ydjy7984zxq','2017-08-30',NULL,'01H','55M','No fim do sÃ©culo XVIII, Don Diego de Zama Ã© um oficial da Coroa Espanhola que deseja partir para Buenos Aires. Ele junta-se a um grupo de soldados Ã  caÃ§a de um perigoso bandido e explora terras distantes habitadas por Ã­ndios selvagens.');
